import React from 'react';
import * as Styled from './ParallaxComponent.styled';
import { Parallax, ParallaxLayer } from '@react-spring/parallax';
import backGround from '../src/assets/background.png';
import jungle1 from '../src/assets/jungle1.png';
import jungle2 from '../src/assets/jungle2.png';
import jungle3 from '../src/assets/jungle3.png';
import jungle4 from '../src/assets/jungle4.png';
import jungle5 from '../src/assets/jungle5.png';
import logoAndLand from '../src/assets/logo_land.png';
import manOnMountain from '../src/assets/man_on_mountain.png';
import mountains from '../src/assets/mountains.png';

function ParallaxComponent() {
  return (
<Parallax pages={2} style={{ top: '0', left: '0' }}>
      <ParallaxLayer offset={0} speed={2.5}>
        <div className="animation_layer parallax" id=""></div>
        <Styled.AnimationLayer className='parallax' id="artback" image={""} />
      </ParallaxLayer>
      <ParallaxLayer offset={0} speed={2.5}>
        <Styled.AnimationLayer className='parallax' id="mountain" image={""} />
      </ParallaxLayer>
      <ParallaxLayer offset={0} speed={2.5}>
        <Styled.AnimationLayer className='parallax' id="logoland" image={""} />
      </ParallaxLayer>
      <ParallaxLayer offset={0} speed={2.5}>
        <Styled.AnimationLayer className='parallax' id="jungle1" image={""} />
      </ParallaxLayer>
      <ParallaxLayer offset={0} speed={2.5}>
        <Styled.AnimationLayer className='parallax' id="jungle2" image={""} />
      </ParallaxLayer>
      <ParallaxLayer offset={0} speed={2.5}>
        <Styled.AnimationLayer className='parallax' id="jungle3" image={""} />
      </ParallaxLayer>
      <ParallaxLayer offset={0} speed={2.5}>
        <Styled.AnimationLayer className='parallax' id="jungle4" image={""} />
      </ParallaxLayer>
      <ParallaxLayer offset={0} speed={2.5}>
        <Styled.AnimationLayer className='parallax' id="manonmountain" image={""} />
      </ParallaxLayer>
      <ParallaxLayer offset={0} speed={2.5}>
        <Styled.AnimationLayer className='parallax' id="jungle5" image={""} />
      </ParallaxLayer>
    </Parallax>

  );
}

export default ParallaxComponent;
